import{_ as t,o as e,c as d,S as n}from"./chunks/framework.8b0da900.js";const m=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"tool/Git Commit Emoji 提交指南.md","filePath":"tool/Git Commit Emoji 提交指南.md","lastUpdated":1670811420000}'),l={name:"tool/Git Commit Emoji 提交指南.md"},r=n('<h2 id="前言" tabindex="-1">前言 <a class="header-anchor" href="#前言" aria-label="Permalink to &quot;前言&quot;">​</a></h2><p>执行 <code>git commit</code> 时，使用 <code>Emoji</code>，可凸显提交信息，易于区分和查找提交历史</p><h2 id="commit-格式" tabindex="-1">Commit 格式 <a class="header-anchor" href="#commit-格式" aria-label="Permalink to &quot;Commit 格式&quot;">​</a></h2><p>提交信息遵从以下格式</p><div class="language-html line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki github-light"><code><span class="line"><span style="color:#24292E;">:emoji:&lt;</span><span style="color:#B31D28;font-style:italic;">type</span><span style="color:#24292E;">&gt;(&lt;</span><span style="color:#B31D28;font-style:italic;">scope</span><span style="color:#24292E;">&gt;): &lt;</span><span style="color:#B31D28;font-style:italic;">subject</span><span style="color:#24292E;">&gt; 不超过 100 个字的摘要，首字母小写，使用祈使语气，句末不加标点</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h2 id="常用-emoji" tabindex="-1">常用 Emoji <a class="header-anchor" href="#常用-emoji" aria-label="Permalink to &quot;常用 Emoji&quot;">​</a></h2><table><thead><tr><th style="text-align:center;">Emoji</th><th style="text-align:center;">代码</th><th style="text-align:center;">说明</th><th style="text-align:center;">英文说明</th></tr></thead><tbody><tr><td style="text-align:center;">🎉 (庆祝)</td><td style="text-align:center;"><code>:tada:</code></td><td style="text-align:center;">初始化提交</td><td style="text-align:center;">Initial commit</td></tr><tr><td style="text-align:center;">✨ (火花)</td><td style="text-align:center;"><code>:sparkles:</code></td><td style="text-align:center;">添加新特性</td><td style="text-align:center;">Introducing new features</td></tr><tr><td style="text-align:center;">🔖 (书签)</td><td style="text-align:center;"><code>:bookmark:</code></td><td style="text-align:center;">发行 / 版本标签</td><td style="text-align:center;">Releasing / Version tags</td></tr><tr><td style="text-align:center;">🐛 (bug)</td><td style="text-align:center;"><code>:bug:</code></td><td style="text-align:center;">修复 bug</td><td style="text-align:center;">Fixing a bug</td></tr><tr><td style="text-align:center;">🚑 (急救车)</td><td style="text-align:center;"><code>:ambulance:</code></td><td style="text-align:center;">核心代码修复</td><td style="text-align:center;">Critical hotfix</td></tr><tr><td style="text-align:center;">🌐 (地球)</td><td style="text-align:center;"><code>:globe_with_meridians:</code></td><td style="text-align:center;">国际化与本地化</td><td style="text-align:center;">Internationalization and localization</td></tr><tr><td style="text-align:center;">💄 (口红)</td><td style="text-align:center;"><code>:lipstick:</code></td><td style="text-align:center;">更新界面和样式文件</td><td style="text-align:center;">Adding or updating the UI and style files</td></tr><tr><td style="text-align:center;">🎬 (场记板)</td><td style="text-align:center;"><code>:clapper:</code></td><td style="text-align:center;">更新演示 / 示例</td><td style="text-align:center;">Update demo / example</td></tr><tr><td style="text-align:center;">🚨 (警车灯)</td><td style="text-align:center;"><code>:rotating_light:</code></td><td style="text-align:center;">移除警告信息</td><td style="text-align:center;">Removing linter warnings</td></tr><tr><td style="text-align:center;">🔧 (扳手)</td><td style="text-align:center;"><code>:wrench:</code></td><td style="text-align:center;">修改配置文件</td><td style="text-align:center;">Changing configuration files</td></tr><tr><td style="text-align:center;">➕ (加号)</td><td style="text-align:center;"><code>:heavy_plus_sign:</code></td><td style="text-align:center;">添加依赖</td><td style="text-align:center;">Adding a dependency</td></tr><tr><td style="text-align:center;">➖ (减号)</td><td style="text-align:center;"><code>:heavy_minus_sign:</code></td><td style="text-align:center;">移除依赖</td><td style="text-align:center;">Removing a dependency</td></tr><tr><td style="text-align:center;">⬆️ (上升箭头)</td><td style="text-align:center;"><code>:arrow_up:</code></td><td style="text-align:center;">升级依赖</td><td style="text-align:center;">Upgrading dependencies</td></tr><tr><td style="text-align:center;">⬇️ (下降箭头)</td><td style="text-align:center;"><code>:arrow_down:</code></td><td style="text-align:center;">依赖降级</td><td style="text-align:center;">Downgrading dependencies</td></tr><tr><td style="text-align:center;">⚡️ (闪电)<br>🐎 (赛马)</td><td style="text-align:center;"><code>:zap:</code><br><code>:racehorse:</code></td><td style="text-align:center;">提升性能</td><td style="text-align:center;">Improving performance</td></tr><tr><td style="text-align:center;">📈 (上升趋势图)</td><td style="text-align:center;"><code>:chart_with_upwards_trend:</code></td><td style="text-align:center;">添加代码跟踪分析</td><td style="text-align:center;">Adding or updating analytics or tracking code</td></tr><tr><td style="text-align:center;">🚀 (火箭)</td><td style="text-align:center;"><code>:rocket:</code></td><td style="text-align:center;">部署程序</td><td style="text-align:center;">Deploying stuff</td></tr><tr><td style="text-align:center;">✅ (白色复选框)</td><td style="text-align:center;"><code>:white_check_mark:</code></td><td style="text-align:center;">添加测试代码</td><td style="text-align:center;">Adding or updating tests</td></tr><tr><td style="text-align:center;">📝 (备忘录)</td><td style="text-align:center;"><code>:memo:</code></td><td style="text-align:center;">撰写文档</td><td style="text-align:center;">Writing docs</td></tr><tr><td style="text-align:center;">🔨 (锤子)</td><td style="text-align:center;"><code>:hammer:</code></td><td style="text-align:center;">重大重构</td><td style="text-align:center;">Major refactoring</td></tr><tr><td style="text-align:center;">🎨 (调色板)</td><td style="text-align:center;"><code>:art:</code></td><td style="text-align:center;">改进代码结构 / 代码格式</td><td style="text-align:center;">Improving structure / format of the code</td></tr><tr><td style="text-align:center;">🔥 (火焰)</td><td style="text-align:center;"><code>:fire:</code></td><td style="text-align:center;">移除代码或文件</td><td style="text-align:center;">Removing code or files</td></tr><tr><td style="text-align:center;">✏️ (铅笔)</td><td style="text-align:center;"><code>:pencil2:</code></td><td style="text-align:center;">修复拼写错误</td><td style="text-align:center;">Fixing typos</td></tr><tr><td style="text-align:center;">🚧 (施工)</td><td style="text-align:center;"><code>:construction:</code></td><td style="text-align:center;">正在进行中</td><td style="text-align:center;">Work in progress</td></tr><tr><td style="text-align:center;">👷 (工人)</td><td style="text-align:center;"><code>:construction_worker:</code></td><td style="text-align:center;">添加 CI 构建到系统</td><td style="text-align:center;">Adding or updating CI build system</td></tr><tr><td style="text-align:center;">💚 (绿心)</td><td style="text-align:center;"><code>:green_heart:</code></td><td style="text-align:center;">修复 CI 构建</td><td style="text-align:center;">Fixing CI Build</td></tr><tr><td style="text-align:center;">🔒 (锁)</td><td style="text-align:center;"><code>:lock:</code></td><td style="text-align:center;">修复安全问题</td><td style="text-align:center;">Fixing security issues</td></tr><tr><td style="text-align:center;">🐳 (鲸鱼)</td><td style="text-align:center;"><code>:whale:</code></td><td style="text-align:center;">Docker 相关工作</td><td style="text-align:center;">Work about Docker</td></tr><tr><td style="text-align:center;">🍎 (苹果)</td><td style="text-align:center;"><code>:apple:</code></td><td style="text-align:center;">修复 macOS 下的问题</td><td style="text-align:center;">Fixing something on macOS</td></tr><tr><td style="text-align:center;">🐧 (企鹅)</td><td style="text-align:center;"><code>:penguin:</code></td><td style="text-align:center;">修复 Linux 下的问题</td><td style="text-align:center;">Fixing something on Linux</td></tr><tr><td style="text-align:center;">🏁 (旗帜)</td><td style="text-align:center;"><code>:checked_flag:</code></td><td style="text-align:center;">修复 Windows 下的问题</td><td style="text-align:center;">Fixing something on Windows</td></tr><tr><td style="text-align:center;">🤖 (机器人)</td><td style="text-align:center;"><code>:robot:</code></td><td style="text-align:center;">修复 Android 平台的问题</td><td style="text-align:center;">Fixing something on Android</td></tr><tr><td style="text-align:center;">🍏 (青苹果)</td><td style="text-align:center;"><code>:green_apple:</code></td><td style="text-align:center;">修复 iOS 平台的问题</td><td style="text-align:center;">Fixing something on iOS</td></tr><tr><td style="text-align:center;">💩 (一坨)</td><td style="text-align:center;"><code>:hankey:</code></td><td style="text-align:center;">改进垃圾代码</td><td style="text-align:center;">Writing bad code that needs to be improved</td></tr><tr><td style="text-align:center;">⏪ (倒带)</td><td style="text-align:center;"><code>:rewind:</code></td><td style="text-align:center;">恢复修改</td><td style="text-align:center;">Reverting changes</td></tr><tr><td style="text-align:center;">🔀 (上下扭曲)</td><td style="text-align:center;"><code>:twisted_rightwards_arrows:</code></td><td style="text-align:center;">合并分支</td><td style="text-align:center;">Merging branches</td></tr><tr><td style="text-align:center;">📦 (包)</td><td style="text-align:center;"><code>:package:</code></td><td style="text-align:center;">更新已编译的文件或包</td><td style="text-align:center;">Adding or updating compiled files or packages</td></tr><tr><td style="text-align:center;">👽 (外星人)</td><td style="text-align:center;"><code>:alien:</code></td><td style="text-align:center;">由于外部 API 更改而更新代码</td><td style="text-align:center;">Updating code due to external API changes</td></tr><tr><td style="text-align:center;">🚚 (卡车)</td><td style="text-align:center;"><code>:truck:</code></td><td style="text-align:center;">移动或重命名文件</td><td style="text-align:center;">Moving or renaming files</td></tr><tr><td style="text-align:center;">📄 (页面)</td><td style="text-align:center;"><code>:page_facing_up:</code></td><td style="text-align:center;">添加或更新许可证</td><td style="text-align:center;">Adding or updating license</td></tr><tr><td style="text-align:center;">💥 (爆炸)</td><td style="text-align:center;"><code>:boom:</code></td><td style="text-align:center;">引入重大变化</td><td style="text-align:center;">Introducing breaking changes</td></tr><tr><td style="text-align:center;">🍱 (便当)</td><td style="text-align:center;"><code>:bento:</code></td><td style="text-align:center;">增加或更新资源文件</td><td style="text-align:center;">Adding or updating assets</td></tr><tr><td style="text-align:center;">👌 (OK 手势)</td><td style="text-align:center;"><code>:ok_hand:</code></td><td style="text-align:center;">更新代码，因为代码审核变更</td><td style="text-align:center;">Updating code due to code review changes.</td></tr><tr><td style="text-align:center;">♿️ (轮椅)</td><td style="text-align:center;"><code>:wheelchair:</code></td><td style="text-align:center;">提高可访问性</td><td style="text-align:center;">Improving accessibility</td></tr><tr><td style="text-align:center;">💡 (灯泡)</td><td style="text-align:center;"><code>:bulb:</code></td><td style="text-align:center;">添加源码注释</td><td style="text-align:center;">Adding or updating comments in source code</td></tr><tr><td style="text-align:center;">🍻 (啤酒)</td><td style="text-align:center;"><code>:beers:</code></td><td style="text-align:center;">醉酒写代码</td><td style="text-align:center;">Writing code drunkenly</td></tr><tr><td style="text-align:center;">💬 (语音气泡)</td><td style="text-align:center;"><code>:speech_balloon:</code></td><td style="text-align:center;">更新文本和字面量</td><td style="text-align:center;">Adding or updating text and literals</td></tr><tr><td style="text-align:center;">🗃 (文件盒)</td><td style="text-align:center;"><code>:card_file_box:</code></td><td style="text-align:center;">执行数据库相关的变化</td><td style="text-align:center;">Performing database related changes</td></tr><tr><td style="text-align:center;">🔊 (喇叭)</td><td style="text-align:center;"><code>:loud_sound:</code></td><td style="text-align:center;">添加日志记录</td><td style="text-align:center;">Adding or updating logs</td></tr><tr><td style="text-align:center;">🔇 (静音)</td><td style="text-align:center;"><code>:mute:</code></td><td style="text-align:center;">删除日志记录</td><td style="text-align:center;">Removing logs</td></tr><tr><td style="text-align:center;">👥 (合作)</td><td style="text-align:center;"><code>:busts_in_silhouette:</code></td><td style="text-align:center;">添加贡献者</td><td style="text-align:center;">Adding or updating contributor(s)</td></tr><tr><td style="text-align:center;">🚸 (儿童过马路)</td><td style="text-align:center;"><code>:children_crossing:</code></td><td style="text-align:center;">提高用户体验 / 可用性</td><td style="text-align:center;">Improving user experience / usability</td></tr><tr><td style="text-align:center;">🏗 (建筑施工)</td><td style="text-align:center;"><code>:building_construction:</code></td><td style="text-align:center;">架构调整</td><td style="text-align:center;">Making architectural changes</td></tr><tr><td style="text-align:center;">📱 (苹果手机)</td><td style="text-align:center;"><code>:iphone:</code></td><td style="text-align:center;">响应式设计</td><td style="text-align:center;">Working on responsive design</td></tr><tr><td style="text-align:center;">🤡 (小丑脸)</td><td style="text-align:center;"><code>:clown_face:</code></td><td style="text-align:center;">模拟数据</td><td style="text-align:center;">Mocking things</td></tr><tr><td style="text-align:center;">🥚 (蛋)</td><td style="text-align:center;"><code>:egg:</code></td><td style="text-align:center;">添加一个彩蛋</td><td style="text-align:center;">Adding or updating an easter egg</td></tr><tr><td style="text-align:center;">🙈 (看不到)</td><td style="text-align:center;"><code>:see_no_evil:</code></td><td style="text-align:center;">添加或更新 .gitignore 文件</td><td style="text-align:center;">Adding or updating a .gitignore file</td></tr><tr><td style="text-align:center;">📸 (相机闪光灯)</td><td style="text-align:center;"><code>:camera_flash:</code></td><td style="text-align:center;">添加或更新快照</td><td style="text-align:center;">Adding or updating snapshots</td></tr><tr><td style="text-align:center;">📌 (图钉)</td><td style="text-align:center;"><code>:pushpin:</code></td><td style="text-align:center;">将依赖项固定到特定版本</td><td style="text-align:center;">Pinning dependencies to specific versions</td></tr><tr><td style="text-align:center;">♻️ (回收)</td><td style="text-align:center;"><code>:recycle:</code></td><td style="text-align:center;">重构代码</td><td style="text-align:center;">Refactoring code</td></tr><tr><td style="text-align:center;">⚗ (相互反应)</td><td style="text-align:center;"><code>:alembic:</code></td><td style="text-align:center;">尝试新事物</td><td style="text-align:center;">Experimenting new things</td></tr><tr><td style="text-align:center;">🔍 (过滤)</td><td style="text-align:center;"><code>:mag:</code></td><td style="text-align:center;">改善SEO</td><td style="text-align:center;">Improving SEO</td></tr><tr><td style="text-align:center;">☸️ (佛法之轮)</td><td style="text-align:center;"><code>:wheel_of_dharma:</code></td><td style="text-align:center;">关于 Kubernetes 的工作</td><td style="text-align:center;">Work about Kubernetes</td></tr><tr><td style="text-align:center;">🏷️ (标签)</td><td style="text-align:center;"><code>:label:</code></td><td style="text-align:center;">添加或更新类型</td><td style="text-align:center;">Adding or updating types (Flow, TypeScript)</td></tr><tr><td style="text-align:center;">🌱 (幼苗)</td><td style="text-align:center;"><code>:seedling:</code></td><td style="text-align:center;">添加或更新数据填充文件</td><td style="text-align:center;">Adding or updating seed files</td></tr><tr><td style="text-align:center;">🚩 (三角旗)</td><td style="text-align:center;"><code>:triangular_flag_on_post:</code></td><td style="text-align:center;">添加，更新或删除功能标志</td><td style="text-align:center;">Adding, updating, or removing feature flags</td></tr><tr><td style="text-align:center;">🥅 (目标网)</td><td style="text-align:center;"><code>:goal_net:</code></td><td style="text-align:center;">捕获异常</td><td style="text-align:center;">Catching errors</td></tr><tr><td style="text-align:center;">💫 (眩晕)</td><td style="text-align:center;"><code>:dizzy:</code></td><td style="text-align:center;">添加或更新动画和过渡</td><td style="text-align:center;">Adding or updating animations and transitions</td></tr><tr><td style="text-align:center;">🗑 (废纸篓)</td><td style="text-align:center;"><code>:wastebasket:</code></td><td style="text-align:center;">弃用需要清除的代码</td><td style="text-align:center;">Deprecating code that needs to be cleaned up</td></tr></tbody></table><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>本文参考于以下文章：<a href="https://blog.cnguu.cn/program/git-commit-emoji-shi-yong-zhi-nan.html" target="_blank" rel="noreferrer">Git commit emoji 食用指南</a>，<a href="https://github.com/carloscuesta/gitmoji" target="_blank" rel="noreferrer">gitmoji 源仓库</a>，<a href="https://github.com/biezhi/gitmoji" target="_blank" rel="noreferrer">gitmoji 汉化仓库</a></p></div>',8),i=[r];function c(a,s,g,o,y,x){return e(),d("div",null,i)}const h=t(l,[["render",c]]);export{m as __pageData,h as default};
